description:
Isn't everybody a little bit Unhinged ? Join Amelia Marni and Ariella Nyssa as they speak all things life, dating, sex, embarrassing moments and all the stuff that no-one actually admits! 

For a little dose of reality, Amelia and Ariella want to break the stigma around the Social Media Highlights and give you a more unfiltered insight into theirs and other guests lives. 

Follow @Chicksunhingedpodcast on Instagram and Tik Tok and get involved ! Send us your most unhinged stories, topics you want to hear about and guests you want to see!

